import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { FixedSizeList } from 'react-window';
// import ChatIcon from '@material-ui/icons/Chat';
import PictureAsPdfRoundedIcon from '@material-ui/icons/PictureAsPdfRounded';
import StarIcon from '@material-ui/icons/Star';
import WorkRoundedIcon from '@material-ui/icons/WorkRounded';
import { Grid, Divider } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    width: 800,
    maxWidth: 800,
    marginLeft: 4,
    // backgroundColor: 'gray'
  },
  text: {
    fontSize: 15
  }
}));

function renderRow(props) {
  const { index, style } = props;
  return (
    <ListItem button style={style} key={index}>
      <Grid container>
        <Grid item md={1}>
          <PictureAsPdfRoundedIcon style={{ fontSize: 25, position: 'absolute', left: 25, top: 10 }} />
        </Grid>
        <Grid item md={1}>
          <button style={{ width: 70, marginTop: 20, height: 30, marginRight: 10 }} className="waves-effect waves-light btn">view</button>
        </Grid>
        <Grid item md={6} style={{ marginLeft: 10}}>
          <ListItemText primary={`Item ${index + 1}`} secondary={"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.  "}
            primaryTypographyProps={{fontSize: 15}}
          />
        </Grid>
        <Grid item md={2}>
          <div style={{ marginTop: 20, }}>
            <StarIcon />
            <StarIcon />
            <StarIcon />
            <StarIcon />
            <StarIcon />
          </div>
        </Grid>
        <Grid item md={1} style={{backgroundColor: 'gray'}}>
          <WorkRoundedIcon style={{  marginTop: 15, color: 'darkgreen' }} />
        </Grid>
      </Grid>
      {/* <ListItemText primary={`Item ${index + 1}`}  secondary={"Owner, Country"} />  position: 'absolute', left: 100, style={{position: 'absolute', left: 200}} 
      <ChatIcon /> */}
      {/* <div style={{height: 70, width: 90,backgroundColor: 'gray',position: 'absolute', left: 0}}> */}

      {/* <Divider /> */}

  


      {/* <StarIcon style={{marginTop: 20, position: 'absolute', left: 988 }} /v */}
    </ListItem>

  );
}

renderRow.propTypes = {
  index: PropTypes.number.isRequired,
  style: PropTypes.object.isRequired,
};

export default function VirtualizedList(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      {/* <h6 style={{backgroundColor: 'gray', textAlign: 'center', height: 40, paddingTop: 10,color: 'white'}}>Currently Present</h6> */}
      <FixedSizeList height={395} width={790} itemSize={45} itemCount={2} style={{ backgroundColor: 'white', }}>
        {renderRow}
      </FixedSizeList>
      <Divider />
    </div>
  );
}
